prediction.sparql:
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?person ?personLabel ( GROUP_CONCAT( DISTINCT STR( ?dod ) ; separator = "; " ) AS ?deathDates ) ( GROUP_CONCAT( DISTINCT STR( ?archivesAt ) ; separator = "; " ) AS ?archivesAtIRIs ) ( GROUP_CONCAT( DISTINCT ?archivesAtLabel ; separator = "; " ) AS ?archivesAtLabels ) WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 ; p:P570 ?dodStmt .
  ?dodStmt ps:P570 ?dod .
  FILTER ( ?dod < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) {
    ?person wdt:P19 ?place .
    ?place wdt:P131 * wd:Q3240 .
  } UNION {
    ?person wdt:P20 ?place .
    ?place wdt:P131 * wd:Q3240 .
  }
  OPTIONAL {
    ?person wdt:P485 ?archivesAt .
    ?archivesAt rdfs:label ?archivesAtLabel .
    FILTER ( LANG( ?archivesAtLabel ) = "en" )
  }
  ?person rdfs:label ?personLabel .
  FILTER ( LANG( ?personLabel ) = "en" )
}
GROUP BY ?person ?personLabel
ORDER BY ?personLabel

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
SELECT DISTINCT ?person ?personLabel ?amountValue ?unit ?unitLabel ?pointInTime ?usdNetWorth ?conversionRate WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 .
  ?person p:P2218 ?stmt .
  ?stmt ps:P2218 ?psAmount .
  OPTIONAL {
    ?stmt psv:P2218 ?valueNode .
    ?valueNode wikibase:quantityAmount ?amountValue .
    OPTIONAL {
      ?valueNode wikibase:quantityUnit ?unit
    }
  }
  ?person wdt:P2218 ?usdNetWorth .
  OPTIONAL {
    ?stmt pq:P585 ?pointInTime
  }
  FILTER ( xsd:decimal ( ?usdNetWorth ) >= 1000000000 ) BIND( xsd:decimal ( ?usdNetWorth ) / COALESCE ( xsd:decimal ( ?amountValue ) , xsd:decimal ( ?usdNetWorth ) ) AS ?conversionRate ) ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" ) .
  OPTIONAL {
    ?unit rdfs:label ?unitLabel FILTER ( LANG( ?unitLabel ) = "en" )
  }
}
ORDER BY DESC ( xsd:decimal ( ?usdNetWorth ) )
LIMIT 500

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?numPartners ( SUM( IF( ?sex = wd:Q6581073 , 1 , 0 ) ) AS ?femaleCount ) ( SUM( IF( ?sex = wd:Q6581072 , 1 , 0 ) ) AS ?maleCount ) WHERE {
  {
    SELECT ?person ?sex ( COUNT( DISTINCT ?partner ) AS ?numPartners ) WHERE {
      ?person wdt:P31 wd:Q5 ; wdt:P106 wd:Q108289408 .
      OPTIONAL {
        ?person wdt:P21 ?sex .
      }
      OPTIONAL {
        ?person wdt:P451 ?partner .
      }
    }
    GROUP BY ?person ?sex
  }
}
GROUP BY ?numPartners
ORDER BY ?numPartners

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?version ?versionLabel ?pub WHERE {
  wd:Q83 p:P348 ?stmt .
  ?stmt ps:P348 ?version .
  OPTIONAL {
    ?stmt pq:P577 ?pub .
  }
  OPTIONAL {
    ?version rdfs:label ?versionLabel .
    FILTER ( LANG( ?versionLabel ) = "en" )
  }
}
ORDER BY COALESCE ( ?pub , "9999-01-01T00:00:00Z" ^^ xsd:dateTime ) ?version

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?lighthouse ?lighthouseLabel ( GROUP_CONCAT( DISTINCT ?colorLabel ; separator = ", " ) AS ?colors ) WHERE {
  ?lighthouse wdt:P31 / wdt:P279 * wd:Q39715 .
  ?lighthouse wdt:P131 * wd:Q504676 .
  ?lighthouse rdfs:label ?lighthouseLabel .
  FILTER ( LANG( ?lighthouseLabel ) = "en" ) OPTIONAL {
    ?lighthouse wdt:P462 ?color .
    OPTIONAL {
      ?color rdfs:label ?colorLabelEn FILTER ( LANG( ?colorLabelEn ) = "en" )
    }
    BIND( COALESCE ( ?colorLabelEn , STR( ?color ) ) AS ?colorLabel )
  }
}
GROUP BY ?lighthouse ?lighthouseLabel
ORDER BY ?lighthouseLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT DISTINCT ?goat ?label ?image ?start ?end ( COALESCE ( ?end , NOW () ) AS ?endOrNow ) WHERE {
  ?goat wdt:P2868 wd:Q151345 .
  OPTIONAL {
    ?goat rdfs:label ?labelEn FILTER ( LANG( ?labelEn ) = "en" )
  }
  OPTIONAL {
    ?goat rdfs:label ?labelDe FILTER ( LANG( ?labelDe ) = "de" )
  }
  OPTIONAL {
    ?goat rdfs:label ?labelNoLang FILTER ( LANG( ?labelNoLang ) = "" )
  }
  BIND( COALESCE ( ?labelEn , ?labelDe , ?labelNoLang , STRAFTER( STR( ?goat ) , "entity/" ) ) AS ?label ) OPTIONAL {
    ?goat wdt:P18 ?image
  }
  OPTIONAL {
    ?goat p:P2868 ?stmt .
    ?stmt ps:P2868 wd:Q151345 .
    OPTIONAL {
      ?stmt pq:P580 ?start
    }
    OPTIONAL {
      ?stmt pq:P582 ?end
    }
  }
}
ORDER BY ?start ?label

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?event ?eventLabel ?tourneyEdition ?tourneyEditionLabel WHERE {
  VALUES ?mensClass {
    wd:Q16893072
  }
  VALUES ?circuit {
    wd:Q300008 wd:Q3775082
  }
  ?event wdt:P2094 ?mensClass .
  ?event wdt:P361 ?tourneyEdition .
  FILTER NOT EXISTS {
    ?event wdt:P1346 ?winner
  }
  .
  ?tourneyEdition wdt:P361 * ?circuit .
  OPTIONAL {
    ?event rdfs:label ?eventLabel FILTER ( LANG( ?eventLabel ) = "en" )
  }
  OPTIONAL {
    ?tourneyEdition rdfs:label ?tourneyEditionLabel FILTER ( LANG( ?tourneyEditionLabel ) = "en" )
  }
}
ORDER BY ?eventLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?person ?personLabel ?death ?fsid ?father ?fatherLabel WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P27 wd:Q16 ; wdt:P2889 ?fsid ; wdt:P570 ?death ; wdt:P22 ?father .
  ?father wdt:P31 wd:Q5 .
  FILTER NOT EXISTS {
    ?father wdt:P2889 ?fatherFS
  }
  ?person rdfs:label ?personLabel .
  FILTER ( LANG( ?personLabel ) = "en" ) OPTIONAL {
    ?father rdfs:label ?fatherLabel .
    FILTER ( LANG( ?fatherLabel ) = "en" )
  }
}
ORDER BY ?personLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?work ?workLabel ?type ?typeLabel ?pubdate ?isbn WHERE {
  VALUES ?author {
    wd:Q35610
  }
  ?work wdt:P50 ?author .
  ?work wdt:P31 ?type .
  FILTER ( ?type IN ( wd:Q571 , wd:Q8261 , wd:Q1279564 , wd:Q7725634 , wd:Q47461344 ) ) OPTIONAL {
    ?work rdfs:label ?workLabel .
    FILTER ( LANG( ?workLabel ) = "en" )
  }
  OPTIONAL {
    ?type rdfs:label ?typeLabel .
    FILTER ( LANG( ?typeLabel ) = "en" )
  }
  OPTIONAL {
    ?work wdt:P577 ?pubdate .
  }
  OPTIONAL {
    ?work wdt:P212 ?isbn .
  }
  FILTER ( ( ?type IN ( wd:Q571 , wd:Q8261 , wd:Q1279564 ) || bound( ?isbn ) || bound( ?pubdate ) || EXISTS {
    ?work wdt:P123 ?publisher
  }
  ) && NOT EXISTS {
    ?work wdt:P31 / wdt:P279 * wd:Q3331189
  }
  && bound( ?workLabel ) )
}
ORDER BY ?workLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ?coord ?officialLang ?officialLangLabel WHERE {
  ?country wdt:P31 wd:Q3624078 .
  OPTIONAL {
    ?country wdt:P625 ?coord .
  }
  OPTIONAL {
    ?country wdt:P37 ?officialLang .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
  OPTIONAL {
    ?officialLang rdfs:label ?officialLangLabel FILTER ( LANG( ?officialLangLabel ) = "en" )
  }
}
ORDER BY ?countryLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel ?inception ?commemorates ?commemoratesLabel ?image ?coord WHERE {
  VALUES ?helsinki {
    wd:Q1757
  }
  {
    ?item wdt:P131 ?helsinki .
  } UNION {
    ?item wdt:P276 ?helsinki .
  }
  FILTER ( EXISTS {
    ?item wdt:P31 / wdt:P279 * wd:Q358
  }
  || EXISTS {
    ?item wdt:P1435 ?anyDesig
  }
  ) OPTIONAL {
    ?item wdt:P571 ?inception .
  }
  OPTIONAL {
    ?item wdt:P547 ?commemorates .
    ?commemorates rdfs:label ?commemoratesLabel .
    FILTER ( LANG( ?commemoratesLabel ) = "en" )
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item wdt:P625 ?coord .
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabel .
    FILTER ( LANG( ?itemLabel ) = "en" )
  }
}
ORDER BY ?item

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?personLabel WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P106 wd:Q10833314 ; wdt:P27 wd:Q31 .
  FILTER NOT EXISTS {
    ?person wdt:P27 ?otherCit .
    FILTER ( ?otherCit != wd:Q31 )
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
}
ORDER BY ?personLabel

PREFIX pr: <http://www.wikidata.org/prop/reference/>
PREFIX prov: <http://www.w3.org/ns/prov#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?country ?countryLabel ?deaths ?date ?refUrl WHERE {
  BIND( wd:Q38 AS ?country ) .
  ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" ) .
  ?country p:P1120 ?stmt .
  ?stmt ps:P1120 ?deaths .
  OPTIONAL {
    ?stmt pq:P585 ?date
  }
  .
  OPTIONAL {
    ?stmt prov:wasDerivedFrom ?ref .
    OPTIONAL {
      ?ref pr:P854 ?refUrl
    }
  }
}
ORDER BY ?date

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?type ( SAMPLE( ?label ) AS ?typeLabel ) ( COUNT( DISTINCT ?org ) AS ?count ) WHERE {
  VALUES ?region {
    wd:Q107356467
  }
  ?org wdt:P31 ?type .
  {
    ?org wdt:P131 * ?region .
  } UNION {
    ?org wdt:P159 ?place .
    ?place wdt:P131 * ?region .
  } UNION {
    ?org wdt:P276 ?place2 .
    ?place2 wdt:P131 * ?region .
  } UNION {
    ?org wdt:P740 ?place3 .
    ?place3 wdt:P131 * ?region .
  }
  ?type wdt:P279 * wd:Q43229 .
  OPTIONAL {
    ?type rdfs:label ?label .
    FILTER ( LANG( ?label ) = "en" )
  }
}
GROUP BY ?type
ORDER BY DESC ( ?count )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel WHERE {
  ?item wdt:P279 * wd:Q87167 .
  OPTIONAL {
    ?item rdfs:label ?itemLabel .
    FILTER ( LANG( ?itemLabel ) = "en" )
  }
}
ORDER BY ?itemLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?prop ?propLabel ?val ?valLabel WHERE {
  wd:Q9696 ?prop ?val .
  FILTER ( STRSTARTS( STR( ?prop ) , "http://www.wikidata.org/prop/direct/" ) ) .
  OPTIONAL {
    ?prop rdfs:label ?propLabel .
    FILTER ( LANG( ?propLabel ) = "en" )
  }
  OPTIONAL {
    ?val rdfs:label ?valLabel .
    FILTER ( LANG( ?valLabel ) = "en" )
  }
}
ORDER BY ?propLabel ?valLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?legalForm ?labelFr ?count WHERE {
  {
    SELECT ?legalForm ?labelFr ?count WHERE {
      {
        SELECT ?lf ( COUNT( DISTINCT ?company ) AS ?cnt ) WHERE {
          ?company wdt:P1616 ?siren ; wdt:P1454 ?lf ; wdt:P17 wd:Q142 .
        }
        GROUP BY ?lf
      }
      BIND( ?lf AS ?legalForm ) BIND( ?cnt AS ?count ) OPTIONAL {
        ?legalForm rdfs:label ?labelFr FILTER ( LANG( ?labelFr ) = "fr" )
      }
      FILTER ( ?count > 499 )
    }
  } UNION {
    SELECT ( IRI( CONCAT ( "http://example.org/other" ) ) AS ?legalForm ) ( "AUTRES" @fr AS ?labelFr ) ( SUM( ?cnt ) AS ?count ) WHERE {
      {
        SELECT ?lf ( COUNT( DISTINCT ?company ) AS ?cnt ) WHERE {
          ?company wdt:P1616 ?siren ; wdt:P1454 ?lf ; wdt:P17 wd:Q142 .
        }
        GROUP BY ?lf
      }
      FILTER ( ?cnt <= 499 )
    }
  }
}
ORDER BY DESC ( ?count )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX geof: <http://www.opengis.net/def/function/geosparql/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?settlement ?settlementLabel ?settCoords ?centerCoords ?distKm ?distMeters WHERE {
  BIND( wd:Q2180733 AS ?center ) .
  ?center wdt:P625 ?centerCoords .
  ?settlement wdt:P625 ?settCoords .
  ?settlement wdt:P31 ?type .
  FILTER ( ?type IN ( wd:Q532 , wd:Q3957 , wd:Q5153359 ) ) {
    ?settlement wdt:P17 wd:Q213 .
  } UNION {
    ?settlement wdt:P131 * ?admin .
    ?admin wdt:P17 wd:Q213 .
  }
  ?settlement wdt:P31 / wdt:P279 * wd:Q486972 .
  BIND( geof:distance ( ?centerCoords , ?settCoords ) AS ?distKm ) BIND( ?distKm * 1000 AS ?distMeters ) FILTER ( ?distKm <= 35 ) OPTIONAL {
    ?settlement rdfs:label ?settlementLabel .
    FILTER ( LANG( ?settlementLabel ) = "en" )
  }
}
ORDER BY ?distKm

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?periodical ?periodicalLabel WHERE {
  ?periodical wdt:P31 / wdt:P279 * wd:Q1002697 .
  ?periodical wdt:P407 wd:Q143 .
  OPTIONAL {
    ?periodical rdfs:label ?periodicalLabel .
    FILTER ( LANG( ?periodicalLabel ) = "en" )
  }
}
ORDER BY ?periodicalLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?city ?cityLabel ( SAMPLE( ?coord ) AS ?coords ) ( MAX( ?pop ) AS ?maxPop ) WHERE {
  ?city wdt:P31 / wdt:P279 * wd:Q515 .
  {
    ?city wdt:P17 wd:Q159 .
  } UNION {
    ?city wdt:P131 * ?adm .
    ?adm wdt:P17 wd:Q159 .
  }
  ?city wdt:P1082 ?pop .
  OPTIONAL {
    ?city wdt:P625 ?coord .
  }
  OPTIONAL {
    ?city rdfs:label ?cityLabel .
    FILTER ( LANG( ?cityLabel ) = "en" )
  }
}
GROUP BY ?city ?cityLabel
HAVING ( MAX( ?pop ) > 100000 )
ORDER BY DESC ( ?maxPop )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?chapter ?jpTitle ?volume ?seriesOrdinal ?pubDate ?pubPlace ?pubPlaceLabelEn WHERE {
  ?chapter wdt:P31 wd:Q53460949 ; wdt:P179 wd:Q3853685 .
  OPTIONAL {
    ?chapter wdt:P1476 ?titleLiteral .
    FILTER ( LANG( ?titleLiteral ) = "ja" )
  }
  OPTIONAL {
    ?chapter rdfs:label ?labJa .
    FILTER ( LANG( ?labJa ) = "ja" )
  }
  BIND( COALESCE ( ?titleLiteral , ?labJa ) AS ?jpTitle ) OPTIONAL {
    ?chapter wdt:P478 ?volume .
  }
  OPTIONAL {
    ?chapter wdt:P1545 ?seriesOrdinal .
  }
  OPTIONAL {
    ?chapter wdt:P577 ?pubDate .
  }
  OPTIONAL {
    ?chapter wdt:P291 ?pubPlace .
    OPTIONAL {
      ?pubPlace rdfs:label ?pubPlaceLabelEn .
      FILTER ( LANG( ?pubPlaceLabelEn ) = "en" )
    }
  }
}
ORDER BY ?seriesOrdinal ?pubDate
LIMIT 1000

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?country ?countryLabel ?capital ?capitalLabel ?capDetMethod ?capDetMethodLabel ?currency ?currencyLabel ?population ?flagImage WHERE {
  ?country wdt:P31 wd:Q3624078 .
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q3024240
  }
  .
  FILTER NOT EXISTS {
    ?country wdt:P31 wd:Q28171280
  }
  .
  FILTER NOT EXISTS {
    ?country wdt:P576 ?end
  }
  .
  OPTIONAL {
    ?country p:P36 ?capStmt .
    ?capStmt ps:P36 ?capital .
    OPTIONAL {
      ?capStmt pq:P459 ?capDetMethod .
    }
  }
  OPTIONAL {
    ?country wdt:P38 ?currency .
  }
  OPTIONAL {
    ?country wdt:P1082 ?population .
  }
  OPTIONAL {
    ?country wdt:P41 ?flagImage .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
  OPTIONAL {
    ?capital rdfs:label ?capitalLabel FILTER ( LANG( ?capitalLabel ) = "en" )
  }
  OPTIONAL {
    ?capDetMethod rdfs:label ?capDetMethodLabel FILTER ( LANG( ?capDetMethodLabel ) = "en" )
  }
  OPTIONAL {
    ?currency rdfs:label ?currencyLabel FILTER ( LANG( ?currencyLabel ) = "en" )
  }
}
ORDER BY ?countryLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?country ?countryLabel ?flagImage ?flagURL ?population WHERE {
  VALUES ?type {
    wd:Q3624078 wd:Q6256
  }
  ?country wdt:P31 ?type ; wdt:P1082 ?population ; wdt:P41 ?flagImage .
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = "en" )
  }
  BIND( CONCAT ( "https://commons.wikimedia.org/wiki/Special:FilePath/" , ?flagImage ) AS ?flagURL )
}
ORDER BY DESC ( ?population )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?person ?personLabel ?occ ?occLabel ?birthplace ?birthplaceLabel ?dob WHERE {
  ?person wdt:P31 wd:Q5 .
  ?person wdt:P106 ?occ .
  VALUES ?occ {
    wd:Q36180 wd:Q482980 wd:Q6625963
  }
  ?person wdt:P27 wd:Q30 .
  ?person wdt:P569 ?dob .
  FILTER ( ?dob >= "1920-01-01T00:00:00Z" ^^ xsd:dateTime ) .
  FILTER NOT EXISTS {
    ?person wdt:P570 ?dod
  }
  .
  ?person wdt:P19 ?birthplace .
  OPTIONAL {
    ?birthplace wdt:P131 ?adm1
  }
  .
  OPTIONAL {
    ?adm1 wdt:P131 ?adm2
  }
  .
  OPTIONAL {
    ?adm2 wdt:P131 ?adm3
  }
  .
  FILTER ( ?birthplace = wd:Q771 || ?adm1 = wd:Q771 || ?adm2 = wd:Q771 || ?adm3 = wd:Q771 ) .
  OPTIONAL {
    ?occ rdfs:label ?occLabel .
    FILTER ( LANG( ?occLabel ) = "en" )
  }
