  }
  || EXISTS {
    ?company wdt:P159 ?hq2 .
    ?hq2 wdt:P17 wd:Q213
  }
  || EXISTS {
    ?company wdt:P159 ?hq3 .
    ?hq3 wdt:P131 * ?admin .
    ?admin wdt:P17 wd:Q213
  }
  ) ?company p:P2139 ?revStmt .
  ?revStmt psv:P2139 ?revValNode .
  ?revValNode wikibase:quantityAmount ?revAmount .
  OPTIONAL {
    ?revValNode wikibase:quantityUnit ?revUnit .
    ?revUnit rdfs:label ?revUnitLabel
