  ?netValNode wikibase:quantityAmount ?netAmount .
  ?netStmt pq:P585 ?date .
  FILTER ( ?revAmount != 0 ) BIND( ( ?netAmount / ?revAmount ) * 100 AS ?profitMarginRaw ) BIND( ( ROUND( ?profitMarginRaw * 100 ) / 100 ) AS ?profitMargin )
