PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
SELECT ?country ?countryLabel ?parts ?partsLabel ( ROUND( ?area_used ) AS ?area_km2 ) WHERE {
  {
    SELECT ?country ?countryLabel ( GROUP_CONCAT( DISTINCT ?part ; separator = "|" ) AS ?parts ) ( GROUP_CONCAT( DISTINCT ?partLabel ; separator = "|" ) AS ?partsLabel ) ( MAX( ?partAreaKm2 ) AS ?partAreaMax ) ( MAX( ?countryAreaKm2 ) AS ?countryAreaMax ) WHERE {
      ?country wdt:P31 wd:Q3624078 .
      FILTER NOT EXISTS {
        ?country wdt:P576 ?end .
      }
      FILTER ( EXISTS {
        ?country wdt:P30 wd:Q46
      }
      || EXISTS {
        ?part wdt:P17 ?country ; wdt:P30 wd:Q46 ; wdt:P31 / wdt:P279 * wd:Q82794
      }
      ) OPTIONAL {
        ?country p:P2046 ?stmtCountry .
        ?stmtCountry ps:P2046 ?amountCountry .
        ?stmtCountry psv:P2046 ?valueCountry .
        ?valueCountry wikibase:quantityAmount ?amountCountry .
        ?valueCountry wikibase:quantityUnit ?unitCountry .
        BIND( IF( ?unitCountry = wd:Q25343 , ( ?amountCountry / 1000000 ) , IF( ?unitCountry = wd:Q712226 , ?amountCountry , IF( ?unitCountry = wd:Q35852 , ( ?amountCountry / 100 ) , ?amountCountry ) ) ) AS ?countryAreaKm2 )
      }
      OPTIONAL {
        ?part wdt:P17 ?country ; wdt:P30 wd:Q46 ; wdt:P31 / wdt:P279 * wd:Q82794 .
        OPTIONAL {
          ?part rdfs:label ?partLabel FILTER ( LANG( ?partLabel ) = "en" )
        }
        OPTIONAL {
          ?part p:P2046 ?stmtPart .
          ?stmtPart ps:P2046 ?amountPart .
          ?stmtPart psv:P2046 ?valuePart .
          ?valuePart wikibase:quantityAmount ?amountPart .
          ?valuePart wikibase:quantityUnit ?unitPart .
          BIND( IF( ?unitPart = wd:Q25343 , ( ?amountPart / 1000000 ) , IF( ?unitPart = wd:Q712226 , ?amountPart , IF( ?unitPart = wd:Q35852 , ( ?amountPart / 100 ) , ?amountPart ) ) ) AS ?partAreaKm2 )
        }
      }
      OPTIONAL {
        ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
      }
    }
    GROUP BY ?country ?countryLabel
  }
  BIND( COALESCE ( ?partAreaMax , ?countryAreaMax ) AS ?area_used ) FILTER ( BOUND( ?area_used ) )
}
ORDER BY DESC ( ?area_used )

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
