  } UNION {
    BIND( wd:Q31063 AS ?item )
  } UNION {
    BIND( wd:Q475038 AS ?item )
  }
  ?item rdfs:label ?itemLabel .
  FILTER ( LANG( ?itemLabel ) = "en" ) {
    SELECT ?item ( SAMPLE( ?popVal ) AS ?population ) ( SAMPLE( ?pd ) AS ?popDate ) WHERE {
      ?item p:P1082 ?ps .
      ?ps ps:P1082 ?popVal .
      OPTIONAL {
        ?ps pq:P585 ?pd
      }
