    GROUP BY ?item
  }
  OPTIONAL {
    {
      SELECT ?item ( SAMPLE( ?a ) AS ?area ) WHERE {
        ?item p:P2046 ?aStmt .
        ?aStmt ps:P2046 ?a .
        FILTER NOT EXISTS {
          ?aStmt pq:P518 ?scopeExcluded .
          {
            FILTER ( ?scopeExcluded = wd:Q187223 || ?scopeExcluded = wd:Q9259 || ?scopeExcluded = wd:Q64364418 || ?scopeExcluded = wd:Q389717 )
          } UNION {
