PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?mun ?munLabel ?recentPop ?recentDate ( YEAR( ?recentDate ) AS ?recentYear ) ?pastPop ?pastDate ( YEAR( ?pastDate ) AS ?pastYear ) WHERE {
  ?mun wdt:P31 wd:Q2074737 ; wdt:P131 * wd:Q93366 .
  ?mun rdfs:label ?munLabel
  FILTER ( LANG( ?munLabel ) = "en" ) .
  OPTIONAL {
    SELECT ?mun ( MAX( ?date ) AS ?recentDate ) WHERE {
      ?mun p:P1082 ?s1 .
      ?s1 ps:P1082 ?v1 .
      ?s1 pq:P585 ?date .
    }
    GROUP BY ?mun
  }
  OPTIONAL {
    ?mun p:P1082 ?stmtRecent .
    ?stmtRecent ps:P1082 ?recentPop .
    OPTIONAL {
      ?stmtRecent pq:P585 ?recentDate .
    }
    FILTER ( ! BOUND( ?recentDate ) || ( BOUND( ?recentDate ) && EXISTS {
      ?stmtRecent pq:P585 ?recentDate
    }
    ) )
  }
  OPTIONAL {
    ?mun wdt:P1082 ?directPop .
    FILTER ( ! BOUND( ?recentPop ) ) BIND( ?directPop AS ?recentPop )
  }
  OPTIONAL {
    BIND( YEAR( ?recentDate ) AS ?recentYear_tmp ) BIND( ( ?recentYear_tmp - 10 ) AS ?targetYear )
  }
  OPTIONAL {
    ?mun p:P1082 ?stmtPast .
    ?stmtPast ps:P1082 ?pastPop .
    ?stmtPast pq:P585 ?pastDate .
    FILTER ( BOUND( ?targetYear ) && YEAR( ?pastDate ) = ?targetYear )
  }
}
ORDER BY ?munLabel

