PREFIX wikibase: <http://wikiba.se/ontology#>
SELECT ?test ?testLabel ?date ?operator ?operatorLabel ?statedAmount ?statedUnitLabel ?normAmount ?kilotons WHERE {
  ?test wdt:P31 wd:Q210112 .
  FILTER NOT EXISTS {
    ?test wdt:P179 ?series
  }
  .
  OPTIONAL {
    ?test wdt:P585 ?date .
  }
  OPTIONAL {
    ?test wdt:P137 ?operator .
    ?operator rdfs:label ?operatorLabel
    FILTER ( LANG( ?operatorLabel ) = "en" )
  }
  OPTIONAL {
    ?test rdfs:label ?testLabel FILTER ( LANG( ?testLabel ) = "en" )
  }
  OPTIONAL {
    ?test p:P2145 ?stmt .
    ?stmt ps:P2145 ?valnode .
    ?valnode wikibase:quantityAmount ?statedAmount .
    OPTIONAL {
      ?valnode wikibase:quantityUnit ?statedUnit .
      ?statedUnit rdfs:label ?statedUnitLabel
      FILTER ( LANG( ?statedUnitLabel ) = "en" )
    }
    OPTIONAL {
      ?valnode wikibase:quantityNormalized ?norm .
      ?norm wikibase:quantityAmount ?normAmount .
      BIND( ( ?normAmount / "4184000000000" ^^ xsd:decimal ) AS ?kilotonsFromNorm )
    }
    OPTIONAL {
      ?valnode wikibase:quantityUnit wd:Q3332822 .
      BIND( ( ?statedAmount * "1000" ^^ xsd:decimal ) AS ?kilotonsFromMegaton )
    }
    OPTIONAL {
      ?valnode wikibase:quantityUnit wd:Q4992853 .
      BIND( ?statedAmount AS ?kilotonsFromKiloton )
    }
    BIND( COALESCE ( ?kilotonsFromNorm , ?kilotonsFromMegaton , ?kilotonsFromKiloton ) AS ?kilotons )
  }
}
ORDER BY ?date
LIMIT 1000

