    }
    ?psnUnit rdfs:label ?rawUnitLabel FILTER ( LANG( ?rawUnitLabel ) = "en" ) BIND( IF( ?psnUnit = wd:Q11574 , ( xsd:decimal ( ?psnAmount ) / 86400 ) , IF( ?psnUnit = wd:Q7727 , ( xsd:decimal ( ?psnAmount ) / 1440 ) , IF( ?psnUnit = wd:Q25235 , ( xsd:decimal ( ?psnAmount ) / 24 ) , IF( ?psnUnit = wd:Q573 , xsd:decimal ( ?psnAmount ) , xsd:decimal ( ?psnAmount ) ) ) ) ) AS ?days ) BIND( "P2047 (normalized)" @en AS ?method ) BIND( ?psnAmount AS ?rawAmount ) ?war rdfs:label ?warLabel FILTER ( LANG( ?warLabel ) = "en" )
