PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?prop ?propLabel WHERE {
  {
    ?prop wikibase:propertyType ?ptype .
    FILTER ( CONTAINS( LCASE( STR( ?ptype ) ) , "time" ) ) OPTIONAL {
      ?prop rdfs:label ?propLabel FILTER ( LANG( ?propLabel ) = "en" )
    }
  } UNION {
    ?prop a wikibase:Property .
    ?prop rdfs:label ?propLabel
    FILTER ( LANG( ?propLabel ) = "en" ) .
    FILTER ( regex( LCASE( STR( ?propLabel ) ) , "\\btime\\b" ) || regex( LCASE( STR( ?propLabel ) ) , "\\bduration\\b" ) )
  } UNION {
    ?prop wdt:P1629 ?typeItem .
    OPTIONAL {
      ?prop rdfs:label ?propLabel FILTER ( LANG( ?propLabel ) = "en" )
    }
    VALUES ?target {
      wd:Q11471 wd:Q26907166
    }
    ?typeItem ( wdt:P361 | wdt:P279 ) * ?target .
  }
}
ORDER BY ?propLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel ?coord WHERE {
  ?item wdt:P31 / wdt:P279 * wd:Q486972 .
  ?item rdfs:label ?itemLabel .
  FILTER ( LANG( ?itemLabel ) = "en" ) .
  FILTER ( REGEX( ?itemLabel , "pol$" , "i" ) ) .
  OPTIONAL {
    ?item wdt:P625 ?coord .
  }
  {
    ?item wdt:P17 wd:Q159 .
  } UNION {
    ?item wdt:P131 * ?admin .
    ?admin wdt:P17 wd:Q159 .
  }
}
ORDER BY ?itemLabel

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?edition ?editionLabel ?tournament ?tournamentLabel ?date ?country ?countryLabel ?surface ?surfaceLabel ?prizeMoney ?numParticipants WHERE {
  {
    SELECT DISTINCT ?edition ?date WHERE {
      ?edition p:P1346 ?winStmt .
      ?winStmt ps:P1346 wd:Q182736 .
      OPTIONAL {
        ?winStmt pq:P585 ?date
      }
    }
  }
  OPTIONAL {
    ?edition wdt:P361 ?tournament .
  }
  OPTIONAL {
    ?edition wdt:P17 ?countryEdition .
  }
  OPTIONAL {
    ?tournament wdt:P17 ?countryTournament .
  }
  OPTIONAL {
    ?edition wdt:P276 ?location .
    ?location wdt:P17 ?countryLocation .
  }
  BIND( COALESCE ( ?countryEdition , ?countryTournament , ?countryLocation ) AS ?country ) OPTIONAL {
    ?edition wdt:P765 ?surfaceEdition .
  }
  OPTIONAL {
    ?tournament wdt:P765 ?surfaceTournament .
  }
  BIND( COALESCE ( ?surfaceEdition , ?surfaceTournament ) AS ?surface ) OPTIONAL {
    ?edition wdt:P2121 ?prizeMoney .
  }
  OPTIONAL {
    ?edition wdt:P1132 ?numParticipants .
  }
  OPTIONAL {
    ?edition rdfs:label ?editionLabel FILTER ( LANG( ?editionLabel ) = "en" )
  }
  OPTIONAL {
    ?tournament rdfs:label ?tournamentLabel FILTER ( LANG( ?tournamentLabel ) = "en" )
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
  OPTIONAL {
    ?surface rdfs:label ?surfaceLabel FILTER ( LANG( ?surfaceLabel ) = "en" )
  }
}
ORDER BY DESC ( ?date )
LIMIT 500

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?candidate ?candidateLabel WHERE {
  VALUES ?jurisdiction {
    wd:Q349340
  }
  ?election wdt:P1001 ?jurisdiction .
  {
    ?election wdt:P726 ?candidate .
  } UNION {
    ?candidate wdt:P3602 ?election .
  }
  ?candidate wdt:P31 wd:Q5 .
  OPTIONAL {
    ?candidate rdfs:label ?candidateLabel .
    FILTER ( LANG( ?candidateLabel ) = "en" )
  }
}
ORDER BY ?candidateLabel

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>

# total number of TV series with an article on Moroccan Arabic Wikipedia
{
  SELECT (COUNT(DISTINCT ?series) AS ?total) WHERE {
    ?article schema:about ?series;
             schema:isPartOf <https://ary.wikipedia.org/> .
    ?series wdt:P31/wdt:P279* wd:Q5398426 .
  }
}

# top properties (excluding external-id properties)
SELECT ?prop ?propLabel (COUNT(DISTINCT ?series) AS ?seriesWith) 
       ((COUNT(DISTINCT ?series) * 100.0) / ?total AS ?percent)
WHERE {
  ?article schema:about ?series;
           schema:isPartOf <https://ary.wikipedia.org/> .
  ?series wdt:P31/wdt:P279* wd:Q5398426 .

  ?series ?p ?o .
  FILTER(STRSTARTS(STR(?p), STR(wdt:)))
  BIND(IRI(REPLACE(STR(?p), STR(wdt:), STR(wd:))) AS ?prop)

  ?prop wikibase:propertyType ?ptype .
  FILTER(?ptype != wikibase:ExternalId)

  OPTIONAL { ?prop rdfs:label ?propLabel . FILTER(LANG(?propLabel) = "en") }
}
GROUP BY ?prop ?propLabel ?total
ORDER BY DESC(?seriesWith)
LIMIT 20

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?place ?placeLabel ?idescat ?population ?area ?coatImage WHERE {
  ?place wdt:P31 ?type .
  ?type wdt:P279 * wd:Q2074737 .
  ?place wdt:P4335 ?idescat .
  FILTER ( STRSTARTS( STR( ?idescat ) , "25" ) ) ?place wdt:P131 * wd:Q5705 .
  OPTIONAL {
    ?place wdt:P1082 ?population .
  }
  OPTIONAL {
    ?place wdt:P2046 ?area .
  }
  OPTIONAL {
    ?place wdt:P94 ?coatImage .
  }
  OPTIONAL {
    ?place rdfs:label ?placeLabel .
    FILTER ( LANG( ?placeLabel ) = "en" )
  }
}
ORDER BY ?idescat

PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?personLabel ?start ?electoralDistrict ?electoralDistrictLabel ?election ?electionLabel WHERE {
  ?person wdt:P31 wd:Q5 .
  ?person p:P39 ?positionStmt .
  ?positionStmt ps:P39 wd:Q29169698 .
  FILTER NOT EXISTS {
    ?positionStmt pq:P582 ?end .
  }
  OPTIONAL {
    ?positionStmt pq:P580 ?start .
  }
  OPTIONAL {
    ?positionStmt pq:P768 ?electoralDistrict .
    ?electoralDistrict rdfs:label ?electoralDistrictLabel .
    FILTER ( LANG( ?electoralDistrictLabel ) = "en" )
  }
  OPTIONAL {
    ?positionStmt pq:P2715 ?election .
    ?election rdfs:label ?electionLabel .
    FILTER ( LANG( ?electionLabel ) = "en" )
  }
  ?person rdfs:label ?personLabel .
  FILTER ( LANG( ?personLabel ) = "en" )
}
ORDER BY ?personLabel
